import React from 'react';
import { secondary, titleTextColor } from './colors.js';
import { makeStyles } from '@material-ui/core/styles';
import { Typography, Button } from '@mui/material';

const useStyles = makeStyles((theme) => ({
  titleText: {
    color: titleTextColor,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    
    letterSpacing: '0.1em',
    display: 'block',
  },
  smallerTextTheme: {
    color: secondary,
    fontWeight: 'bold',
    fontFamily: 'Montserrat',
    fontSize: '0.75em',
    letterSpacing: '0.1em',
    marginTop: '20px',
    marginRight: '50px',
    display: 'block',
  },
  center: {
    display: 'flex',
    justifyContent: 'center',
    alignItems: 'center',
    flex: 1,
    flexDirection: 'column',
  },
}));

const firstLetter = { fontSize: '1.3em' };

function TitleContent() {
  const classes = useStyles();
  return (
    <div className={classes.center}>
      <div className={classes.titleText} style={{fontSize: '3em',}}>
        EAN VANDERGRAAF
      </div>
      <div className={classes.smallerTextTheme}>Software Engineer</div>
      <div className={classes.smallerTextTheme}>helloa</div>
    </div>
  );
}

export default TitleContent;
